"multishare.publish.format.png":{en:"PNG"},"dialog.freeLimitations.reason.visio":{en:"Edit or export Visio files"},"gui.growl.work.offline":{en:"Now work offline! Try our new Chrome App"},"googleclassroom.welcome.body":{en:"Lucidpress can help teachers create, distribute, and grade assignments. Students can complete and turn in those assignments, as well as add documents to a digital portfolio."},"footer.ipad":{en:"iPad mockup"},"payment.startSubscription.trialMessage":{fr:"Vous souhaitez modifier votre abonnement? Activez votre abonnement Lucid%s dès maintenant. A la fin de votre période d'essai, vous basculerez vers un compte gratuit. Les fonctionnalités disponibles seront limitées et certaines actions restreintes, mais vous pourrez toujours accéder à vos documents. Vous n'avez pas encore fait votre choix? %s",
en:"Ready to upgrade? Pay now to lock-in your Lucid%s subscription. If you let your trial expire, you will be downgraded to a free account. You’ll have limited features and some restrictions on use, but you’ll still be able to access your documents. Not ready? %s.",nl:"Klaar om te upgraden? Betaal nu om u van uw Lucid%s abonnement te verzekeren. Als u uw proefperiode laat verlopen, wordt u gedowngrade naar een gratis account. U zal gelimiteerde eigenschappen en wat beperkingen op het gebruik hebben, maar u zal echter nog steeds toegang hebben tot uw documenten. Nog niet klaar? %s",
pt:"Pronto para fazer um upgrade? Pague agora para garantir a sua assinatura Lucid%s. Se você deixar seu período de trial expirar, você será rebaixado para uma conta gratuita.  Você terá recursos limitados e algumas restrições de uso, mas você ainda poderá acessar seus documentos. Não está pronto? %s",no:"Klar for å oppgradere? Betal nå for å låse ditt Lucid%s-abonnement. Hvis ditt prøveabonnement utløper, så vil du bli nedgradert til en gratiskonto. Du vil få begrensede funksjoner og restriksjoner på bruk, men du vil fortsatt ha tilgang til dine dokumenter. Ikke klar? %s",
"zh-tw":"準備好升級了？現在付款鎖定您的 LucidX 計劃。如果您的試用版過期，您將降級為免費帳戶。您對服務的使用和功能將受到限制，但您依然可以訪問您的文檔。尚未準備好？ %s",de:"Bereit für Ihr Upgrade? Bezahlen Sie jetzt, um Ihr Lucid%s Abonnement zu sichern. Wenn Ihr Probeabonnement ausläuft, wird Ihr Account auf die kostenlose Version herabgestuft. Sie werden weniger Funktionen nutzen können und einige Einschränkungen erhalten. Trotzdem werden Sie Zugriff auf Ihre Dokumente haben. Noch nicht bereit? %s",da:"Klar til at opgradere? Betal nu for at fastlåse dit Lucid%s abonnement. Hvis du lader prøveperioden udløbe, vil du blive nedgraderet til gratis konto. du vil have begrænsede funktioner og visse brugsbegrænsninger, men du vil stadig have adgang til dine dokumenter. Ikke klar? %s",
"zh-cn":"准备好升级了？现在付款锁定您的 LucidX 计划。如果您的试用版过期，您将降级为免费帐户。您对服务的使用和功能将受到限制，但您依然可以访问您的文档。尚未准备好？ %s",ja:"アップグレードの準備はできていますか?　Lucid%s定期購買を今から開始しましょう。試用期間が終了してしまった場合、アカウントは自動的に無料アカウントに移行してしまい、機能、利用範囲の制限が行われてしまいますが、ドキュメントへのアクセスは可能です。 まだ準備できていませんか? %s",es:"¿Listo para Ascender? Pague ahora para asegurar su suscripción a Lucid%s. Si deja que expire el período de prueba, descenderá a una cuenta gratuita, lo cual implica prestaciones limitadas y algunas restricciones de uso, sin embargo aún podrá acceder a sus documentos. ¿Aún no está listo?  %s"},
