"persona.survey.consulting":{en:"Management Consulting"},"user.close.reason.finished":{en:"My current project has finished / I have no further use for diagramming"},"embedpanel.chkbox.label":{fr:"Publie le lien",en:"Publish Link",zh:"发布链接"},"pricing.quote1.content":{fr:"Beaucoup de nos clients souhaitent communiquer par des documents Visio, et avec Lucidchart, nous pouvons exporter les fichiers en format Visio. Lorsque nous envoyons ces diagrammes, nous pouvons choisir le format PDF ou Visio, et cette flexibilité est très importante. De plus, Lucidchart était moins cher et ne nécessitait pas une installation sur l'ordinateur de tout le monde.",
en:"A lot of our customers want to communicate through Visio documents, and with Lucidchart, we can export into standard Visio file formats. When we send those diagrams, we can choose from PDF or Visio format, and that flexibility is very important. Plus, Lucidchart was less expensive and didn't need to be installed on everybody's machine.",nl:"Veel van onze klanten willen communiceren via Visio-documenten, en met Lucidchart kunnen we exporteren naar standaard Visio-bestandsformaten. Wanneer we deze diagrammen versturen, kunnen we kiezen uit PDF-of Visio-formaat, en die flexibiliteit is zeer belangrijk. Bovendien was Lucidchart minder duur en hoefde het niet op elke machine geïnstalleerd te worden.",
pt:"Muitos de nossos clientes querem se comunicar usando documentos do Visio e, com o Lucidchart, podemos exportar para formatos de arquivos padrão do Visio. Quando enviamos esses diagramas, podemos escolher entre o formato PDF ou Visio, e essa flexibilidade é muito importante. Além disso, o Lucidchart era mais barato e não precisava ser instalado na máquina de todos.",no:"Mange av våre kunder vil kommunisere gjennom Visiodokumenter, og med Lucidchart kan vi eksportere til standard Visioformater. Når vi sender disse diagrammene, kan vi velge mellom PDF eller Visioformat, og denne fleksibiliteten er veldig viktig. I tillegg var Lucidchart billigere og måtte ikke installeres på alle maskinene.",
de:"Viele unserer Kunden wollen gern mittels Visio-Dokumenten kommunizieren. Mit Lucidchart können wir einfach in standardmäßige Visio-Dateiformate exportieren. Beim Senden dieser Diagramme können wir zwischen PDF und Visio-Format wählen und diese Flexibilität ist enorm wichtig für uns. Darüber hinaus war Lucidchart günstiger und wir mussten es nicht auf allen Computern installieren.",da:"Mange af vores kunder ønsker at kommunikere gennem Visio dokumenter, og med Lucidchart, kan vi eksportere ind i standard Visio filformater. Når vi sender disse diagrammer, kan vi vælge mellem PDF eller Visio format, og den fleksibilitet er meget vigtig. Plus, Lucidchart var billigere, og behøvede ikke at blive installeret, på alles maskiner.",
es:"Muchos de nuestros clientes quieren comunicarse con documentos de Visio, y con Lucidchart podemos exportar archivos a formatos estándar de Visio. Al enviar esos diagramas, podemos elegir entre los formatos PDF o Visio, y esa flexibilidad es muy importante. Además, Lucidchart era más barato y no había que instalarlo en todos los ordenadores."},"registerLevel.eduPricing.prompt":{en:"Are you an EDU user?"},"amazonsurvey.description":{en:"In an effort to better understand our customers, we’re offering a <strong>$25 Amazon Gift Card</strong> for a short phone call about how you use Lucidchart. Fill out this survey and we’ll contact you if you qualify."},
